import React, { useEffect } from 'react';
import WOW from 'wowjs';
import 'animate.css';

const TestAnimation = () => {
  useEffect(() => {
    new WOW.WOW({
      live: false,
    }).init();
  }, []);

  return (
    <div className="wow  animate__slideInUp" data-wow-delay="0.5s">
      <h1>This is a test for zoomIn animation</h1>
    </div>
  );
};

export default TestAnimation;
